import "./Person.css";

import React from 'react'

const Person = (props) => {
  return (
    <div className="container">
            <div className='person'>
                <div className="image">
               <img src = {props.picture} alt="profile"/>
                </div>
                <h1>{props.name}</h1>
               
            </div>
    </div>
  )
}

export default Person
